pragma solidity ^0.5.0;

contract Plantacao {
    struct Plantou {
        uint id;
        string produto;
        int quantidade;
        uint lote;
    }

    mapping(uint => Plantou) public Plantados;

    uint public PlantacaoCount;

    //uint public ColheitaLote;

    function addPlantacao(string memory _produto, int _quantidade, uint lote) public {
        PlantacaoCount ++;
        //ColheitaLote ++;
        Plantados[PlantacaoCount-1] = Plantou(PlantacaoCount, _produto, _quantidade,lote);
    }

    function getPlantacaoProduto(uint id) public view returns (string memory){
        return Plantados[id].produto;
    }

    function getPlantacaoQuantidade(uint id) public view returns (int){
        return Plantados[id].quantidade;
    }
    function getPlantacaoLote(uint id) public view returns (uint){
        return Plantados[id].lote;
    }

    function getPlantacaoIdPorLote(uint lote) public view returns (uint[] memory){

        uint[] memory array = new uint[](PlantacaoCount);
        uint j = 0;
        for(uint8 i = 0; i <= PlantacaoCount; i++){
            if (lote==Plantados[i].lote){
                array[j] = (Plantados[i].id);
                j++;
            }
        }
        return array;
    }

}
